text_show:
Coincidindo cunha data festiva moi especial e singularmente vencellada ás castañas, o salón de plenos do Concello de Ourense acollía a presentación da tarta nipona “Ena-ka-Wakamiya”, que saía este ano ao mercado e que está elaborada con castañas da provincia da empresa Posada Marrón Glacé. Este doce, que logra unha simbiose especial entre a castaña ourensá e a xaponesa, ten suposto un éxito de vendas. A presentación contaba coa asistencia do presidente da citada empresa xaponesa, Shingo Kamada; 
..........
 Vázquez. Este acto supón todo un xesto á cidade de Ourense e á súa festividade do San Martiño por parte da firma nipona. Ademais, Shingo Kamada chega nesta ocasión á provincia, acompañado dunha delegación de empresarios da castaña xaponesa e de representantes da empresa Posada Marrón Glacé, co fin de coñecer o magosto que se celebra nestes días. Xa ten estado noutras ocasións en Ourense, a última foi en novembro de 2013 con motivo da homenaxe póstuma que se lle tributada ao empresario José Posa
